import React from 'react';
import './like.css'
import up from '../../../../upVote.png'
import down from '../../../../downVote.png'

function Like({id}) {

  const like = Math.round(Math.random()* 1000)

    return (
      <div className={'like' }>
          <img src={up} alt={'up vote'} className={'vote'}></img>
            <p id={'like'+id} >{like}</p>
          <img src={down} alt={'down vote'} className={'vote'}></img>
      </div>
    );
  }

  export default Like;
